CREATE TABLE m_card_appearance(
  card_m_id INTEGER NOT NULL,
  appearance_type INTEGER NOT NULL,
  card_name TEXT NOT NULL,
  pronunciation TEXT NOT NULL,
  image_asset_path TEXT NOT NULL,
  thumbnail_asset_path TEXT NOT NULL,
  still_thumbnail_asset_path TEXT NOT NULL,
  background_asset_path TEXT NOT NULL,
  live_deck_asset_path_id TEXT NOT NULL,
  PRIMARY KEY (card_m_id, appearance_type),
  FOREIGN KEY (card_m_id) REFERENCES m_card(id),
  FOREIGN KEY (live_deck_asset_path_id) REFERENCES m_card_trimming_live_deck(id)
);
